  questionAnswer2: "\xAB\u041B\u043E\u0436\u043D\u044B\u043C\xBB \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0438 \u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u0435 false.\n\n\u041B\u044E\u0431\u043E\u0435 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u0435, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u043D\u0435 \u0432\u0445\u043E\u0434\u0438\u0442 \u0432 \u044D\u0442\u043E\u0442 \u0441\u043F\u0438\u0441\u043E\u043A, \u043F\u0440\u0438 \u0435\u0433\u043E \u043F\u0440\u0435\u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u043D\u0438\u0438 \u043A \u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u043C\u0443 \u0442\u0438\u043F\u0443, \u043F\u0440\u0435\u0432\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044F \u0432 true (\u0442\u0430\u043A\u0438\u0435 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F \u043D\u0430\u0437\u044B\u0432\u0430\u044E\u0442 \xAB\u0438\u0441\u0442\u0438\u043D\u043D\u044B\u043C\u0438\xBB \u2014 truthy). \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440:",
